import React from "react";
import Form from "./Form";
import axios from "axios";

function Page(){
    function getWebsites(url) {
        console.log(url)
        axios.post('http://localhost:5000/crawler', {url: url}).then(function(response){console.log(response)})
    }

    return (
      <div className="m-6">
        <h1 className="text-3xl font-bold text-teal-600"> Webcrawler </h1>
        <Form getWebsites={getWebsites} />
      </div>
    );
}

export default Page
